package uz.coder.daggerhilt.database.daoimport androidx.room.Daoimport androidx.room.Insertimport androidx.room.OnConflictStrategy.REPLACEimport androidx.room.Queryimport uz.coder.daggerhilt.database.entity.UserEntity@Daointerface UserDao {    @Insert    suspend fun insertUser(entity: UserEntity)    @Insert(onConflict = REPLACE)    suspend fun insertUser(entity: List<UserEntity>)    @Query("select * from userentity")    suspend fun getUsers():List<UserEntity>}